 let a,b;
 
function add(a,b){
	
	return (a+b);
};
function sub(a,b){
	
	return (a-b);
};
function mult(a,b){
	
return(a*b);
};

function div(a,b){
	
return(a/b);
};


export{add,sub,mult,div};
